/**
 * Fisher-Yates shuffle algorithm for random sorting
 * @param {Array} array - Array to shuffle
 * @returns {Array} Shuffled array
 */
const shuffleArray = (array) => {
  const shuffled = [...array];
  for (let i = shuffled.length - 1; i > 0; i--) {
    const j = Math.floor(Math.random() * (i + 1));
    [shuffled[i], shuffled[j]] = [shuffled[j], shuffled[i]];
  }
  return shuffled;
};

/**
 * Generate catalog items from real Perekrestok data
 * @returns {Array} Generated catalog items (randomly shuffled)
 */
export const generateCatalog = () => {
  const items = PRODUCTS_DATA.map((product, index) => ({
    id: product.id,
    title: product.title,
    category: product.category,
    basePrice: product.price,
    image: product.image,
    expiryDate: new Date(Date.now() + (Math.random() * 48 + 5) * 3600000),
    storeName: STORES[index % STORES.length].name,
    storeAddress: STORES[index % STORES.length].address,
    rating: (4.1 + Math.random() * 0.9).toFixed(1),
    reviewsCount: Math.floor(Math.random() * 150) + 10,
    maxQuantity: Math.floor(Math.random() * 8) + 3,
    description: 'Продукт высочайшего качества. Реализуется по программе бережного потребления Robin Food.',
    characteristics: {
      'Вес': product.title.match(/\d+г|\d+кг/)?.[0] || '400г',
      'Бренд': 'Robin Food',
      'Упаковка': 'Эко',
    },
  }));
  
  // Shuffle items for random order on each load
  return shuffleArray(items);
};

// Pre-generated catalog for use throughout the app (473 items: 273 мясо + 107 молоко + 35 выпечка + 58 рыба)
// Items are randomly shuffled on each app load
export const MASTER_CATALOG = generateCatalog();
